import React, { useEffect, useRef } from "react";
import * as d3 from "d3";
import SpotifyWebApi from "spotify-web-api-node";

function Mood({ accessToken }) {
    const ref = useRef();
    const spotifyApi = useRef(
        new SpotifyWebApi({
            clientId: "6ba0cc8b29e145ea99f2401c09a35e6e",
        })
    );

    // Define the zoomed function outside of the useEffect hook
    function zoomed(event) {
        const g = d3.select(ref.current).select("g");
        g.attr("transform", event.transform);
    }

    useEffect(() => {
        if (!accessToken) return;
        spotifyApi.current.setAccessToken(accessToken);
        spotifyApi.current
            .getMyRecentlyPlayedTracks({ limit: 50 })
            .then((response) => {
                const trackIds = response.body.items.map(item => item.track.id);
                return spotifyApi.current.getAudioFeaturesForTracks(trackIds);
            })
            .then((response) => {
                const audioFeatures = response.body.audio_features;

                const moodData = audioFeatures.map((features, index) => ({
                    date: new Date().getTime() - index * 1000 * 60 * 60 * 24, // This is a placeholder. You should use the actual play time of each track.
                    valence: features.valence,
                }));

                const moodCategory = (valence) =>
                    valence < 0.33 ? "Sad" : valence < 0.66 ? "Neutral" : "Happy";
                moodData.forEach((d) => {
                    d.mood = moodCategory(d.valence);
                });

                const svg = d3.select(ref.current);
                const margin = { top: 20, right: 20, bottom: 50, left: 50 };
                const width = 960 - margin.left - margin.right;
                const height = 500 - margin.top - margin.bottom;

                const colorScale = d3.scaleOrdinal()
  .domain(["Sad", "Neutral", "Happy"])
  .range(["#1f77b4", "#ff7f0e", "#2ca02c"]);

                const xScale = d3
                    .scaleTime()
                    .domain(d3.extent(moodData, (d) => d.date))
                    .range([0, width]);
                const yScale = d3.scaleLinear().domain([0, 1]).range([height, 0]);

                const line = d3
                    .line()
                    .x((d) => xScale(d.date))
                    .y((d) => yScale(d.valence));

                    const legend = svg.append("g")
  .attr("font-family", "sans-serif")
  .attr("font-size", 10)
  .attr("text-anchor", "end")
  .selectAll("g")
  .data(colorScale.domain().slice().reverse())
  .enter().append("g")
  .attr("transform", (d, i) => "translate(0," + i * 20 + ")");

                const g = svg
                    .append("g")
                    .attr(
                        "transform",
                        "translate(" + margin.left + "," + margin.top + ")"
                    );

                g.append("g")
                    .attr("transform", "translate(0," + height + ")")
                    .call(d3.axisBottom(xScale))
                    .append("text")
                    .attr("fill", "#fff")
                    .attr("y", 20)
                    .attr("x", width / 2)
                    .attr("dy", "0.71em")
                    .attr("text-anchor", "end")
                    .text("Time");

                g.append("g")
                    .call(d3.axisLeft(yScale))
                    .append("text")
                    .attr("fill", "#fff")
                    .attr("transform", "rotate(-90)")
                    .attr("y", -40)
                    .attr("dy", "0.71em")
                    .attr("text-anchor", "end")
                    .text("Mood (valence)");

                // Add a tooltip
                const tooltip = d3.select("body").append("div")
                    .style("position", "absolute")
                    .style("z-index", "10")
                    .style("visibility", "hidden")
                    .style("background", "#333")
                    .style("border-radius", "5px")
                    .style("color", "#fff")
                    .style("padding", "10px")
                    .style("opacity", "0.7")
                    .text("a simple tooltip");

                g.selectAll(".dot")
                    .data(moodData)
                    .enter().append("circle")
                    .attr("class", "dot")
                    .attr("cx", (d) => xScale(d.date))
                    .attr("cy", (d) => yScale(d.valence))
                    .attr("r", 5)
                    .on("mouseover", function (d) {
                        tooltip.text(`Mood: ${d.mood}, Valence: ${d.valence}`);
                        return tooltip.style("visibility", "visible");
                    })
                    .on("mousemove", function (event) {
                        return tooltip
                            .style("top", event.pageY - 10 + "px")
                            .style("left", event.pageX + 10 + "px");
                    })
                    .on("mouseout", function () {
                        return tooltip.style("visibility", "hidden");
                    });

                const area = d3.area()
                    .x((d) => xScale(d.date))
                    .y0(height)
                    .y1((d) => yScale(d.valence));

                    g.append("path")
                    .datum(moodData)
                    .attr("fill", d => colorScale(d.mood))
                    .attr("d", area);

                svg
                    .append("text")
                    .attr("x", width / 2)
                    .attr("y", 20)
                    .attr("text-anchor", "middle")
                    .style("font-size", "20px")
                    .style("text-decoration", "underline")
                    .style("fill", "#fff")
                    .text("Mood Over Time");

                const zoom = d3
                    .zoom()
                    .scaleExtent([1, 10])
                    .translateExtent([
                        [0, 0],
                        [width, height],
                      ])
                      .on("zoom", zoomed);

                    svg.call(zoom);
                  });
              }, [accessToken]);

              return <svg ref={ref} width="960" height="500" />;
            }

            export default Mood;
